import Sidebar from "./../component/Sidebar"


export default function Blog() {
    return (
      <div>
        <h1>My Blog</h1>
        <Sidebar
        routes={"routes"}
        logoText={"Creative Tim"}
        logo={'logo'}
        image={'image'}
        handleDrawerToggle={'handleDrawerToggle'}
        open={false}
        color={'red'}
        
      />
   
        
      </div>
    );
  }
